import React, { useState } from "react";
import axios from "axios";
import "../css/"; // Import the CSS file

const ResumeForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    summary: "",
    skills: [],
    education: [{ degree: "", university: "", year: "" }],
    experience: [{ jobTitle: "", company: "", startDate: "", endDate: "", description: "" }],
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleArrayChange = (index, field, value, type) => {
    const updatedArray = [...formData[type]];
    updatedArray[index][field] = value;
    setFormData({ ...formData, [type]: updatedArray });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:5000/generate-resume", formData, {
        responseType: "blob", // For downloading the PDF
      });

      // Create a download link
      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", "resume.pdf");
      document.body.appendChild(link);
      link.click();
      link.remove();
    } catch (error) {
      console.error("Error generating resume:", error);
    }
  };

  return (
    <div className="resume-container">
      <h2>Resume Builder</h2>
      <form className="resume-form" onSubmit={handleSubmit}>
        <input type="text" name="name" placeholder="Full Name" onChange={handleChange} required />
        <input type="email" name="email" placeholder="Email" onChange={handleChange} required />
        <input type="text" name="phone" placeholder="Phone" onChange={handleChange} required />
        <textarea name="summary" placeholder="Summary" onChange={handleChange} required></textarea>

        <h3>Skills</h3>
        <input
          type="text"
          name="skills"
          placeholder="Comma separated skills"
          onChange={(e) => setFormData({ ...formData, skills: e.target.value.split(",") })}
          required
        />

        <h3>Education</h3>
        <div className="education-section">
          {formData.education.map((edu, index) => (
            <div key={index}>
              <input type="text" placeholder="Degree" onChange={(e) => handleArrayChange(index, "degree", e.target.value, "education")} />
              <input type="text" placeholder="University" onChange={(e) => handleArrayChange(index, "university", e.target.value, "education")} />
              <input type="text" placeholder="Year" onChange={(e) => handleArrayChange(index, "year", e.target.value, "education")} />
            </div>
          ))}
        </div>

        <h3>Experience</h3>
        <div className="experience-section">
          {formData.experience.map((exp, index) => (
            <div key={index}>
              <input type="text" placeholder="Job Title" onChange={(e) => handleArrayChange(index, "jobTitle", e.target.value, "experience")} />
              <input type="text" placeholder="Company" onChange={(e) => handleArrayChange(index, "company", e.target.value, "experience")} />
              <input type="text" placeholder="Start Date" onChange={(e) => handleArrayChange(index, "startDate", e.target.value, "experience")} />
              <input type="text" placeholder="End Date" onChange={(e) => handleArrayChange(index, "endDate", e.target.value, "experience")} />
              <textarea placeholder="Description" onChange={(e) => handleArrayChange(index, "description", e.target.value, "experience")}></textarea>
            </div>
          ))}
        </div>

        <button type="submit" className="submit-btn">Generate Resume</button>
      </form>
    </div>
  );
};

export default ResumeForm;
